import java.util.*;

public class ValidAnagram {

    public static void main (String[] args) {

        // System.out.println(isAnagram("anagram", "nagaram"));
        // System.out.println(isAnagram("cat", "rat"));

        String s = "";
        String t = "";

        System.out.println(isAnagram(s, t));
    }

    public static boolean isAnagram(String s, String t) {
        Map<Character, Integer> sMap = new HashMap<>();
        Map<Character, Integer> tMap = new HashMap<>();

        if (s.length() != t.length())
            return false;

        for (int i = 0; i < s.length(); i++) {
            if (sMap.containsKey(s.charAt(i))) {
                sMap.put(s.charAt(i), sMap.get(s.charAt(i)) + 1);
            } else {
                sMap.put(s.charAt(i), 1);
            }
        }

        for (int j = 0; j<t.length(); j++) {
            if (tMap.containsKey(t.charAt(j))) {
                tMap.put(t.charAt(j), tMap.get(t.charAt(j)) + 1);
            } else {
                tMap.put(t.charAt(j), 1);
            }
        }

        for(var entry : sMap.entrySet()) {            
            var key = entry.getKey();
            var value = entry.getValue();
            if(tMap.containsKey(key)) {
                var tValue = tMap.get(key);
                if (!tValue.equals(value))
                    return false;
            } else {
                return false;
            }
        }
        return true;

    }
}